import { HttpClientModule } from '@angular/common/http';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AllMoviesComponent } from './components/all-movies/all-movies.component';
import { MovieByIdComponent } from './components/movie-by-id/movie-by-id.component';
import { TopRatedMoviesComponent } from './components/top-rated-movies/top-rated-movies.component';
import { MoviesService } from './services/movies.service';
import { AddFavoriteMovieComponent } from './components/add-favorite-movie/add-favorite-movie.component';
import { RemoveFavoriteMovieComponent } from './components/remove-favorite-movie/remove-favorite-movie.component';

@NgModule({
  declarations: [
    AppComponent,
    AllMoviesComponent,
    TopRatedMoviesComponent,
    MovieByIdComponent,
    AddFavoriteMovieComponent,
    RemoveFavoriteMovieComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
  ],
  providers: [MoviesService],
  bootstrap: [AppComponent]
})
export class AppModule { }
